import React from "react";
import Button from "./Button";

function Rectangle() {
  return (
    <div className="rectangleWrapper">
      <div className="containerRectangle">
        <div className="rectangle">
            <Button />
        </div>
        <div className="rectangle">
          <Input checked={false}/>
        </div>
        <div className="rectangle">
          <Input checked={false}/>
        </div>
      </div>
    </div>
  );
}

export default Rectangle;
